import React from "react";
import Emailimg from "../assets/Emailimg.png";
import Grid from "@mui/joy/Grid";
import { Link } from "react-router-dom";
import Home from "../assets/Home.png";


function Footer() {
return(
<Grid className="whiteLandingContainer centerContainer footer">
        <a href="mailto:garlandcollette@gmail.com" className="centerContainer">
          <img
            src={Emailimg}
            alt="Email"
            style={{ padding: "5px", width: "10%" }}
          />
        </a>
        <Link to="/">
          <img src={Home} alt="Home" style={{ padding: "5px", width: "40%"  }} />
        </Link>
      </Grid>

    );
}
export default Footer;
